import React from 'react';
import { Navbar, Nav, NavDropdown, Container } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import './MyNavbar.css'; // Import the custom CSS
const MyNavbar = () => {
  return (
    <Navbar bg="light" expand="lg" sticky="top">
      <Container style={{ maxWidth: '1400px' }} className="justify-content-center">
        <Navbar.Brand as={NavLink} to="/">Brand</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link as={NavLink} to="/" end>Home</Nav.Link>
            <Nav.Link as={NavLink} to="/about-us">About Us</Nav.Link>
            <NavDropdown title="Insights" id="insights-nav-dropdown">
              <NavDropdown.Item as={NavLink} to="/staffing">Staffing</NavDropdown.Item>
              <NavDropdown.Item as={NavLink} to="/consulting">Consulting</NavDropdown.Item>
              <NavDropdown.Item as={NavLink} to="/hr-tech">HR Tech</NavDropdown.Item>
            </NavDropdown>
            <Nav.Link as={NavLink} to="/careers">Careers</Nav.Link>
            <NavDropdown title="Resources" id="resources-nav-dropdown">
              <NavDropdown.Item as={NavLink} to="/blogsy">Blogsy</NavDropdown.Item>
              <NavDropdown.Item as={NavLink} to="/newsletter">Newsletter</NavDropdown.Item>
            </NavDropdown>
            <Nav.Link as={NavLink} to="/contact-us">Contact Us</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};
export default MyNavbar;
